import React from 'react';
import {
  Home,
  MessageSquare,
  Search,
  Shield,
  MessageCircle,
  LogOut,
  Building2,
} from 'lucide-react';
import { useNavigate, useLocation } from 'react-router-dom';
import { useAppContext } from '../context/AppContext';
import { Button } from './ui/button';
import { Badge } from './ui/badge';

const Header = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const { state, logoutUser, toggleChatbot } = useAppContext();
  const { user } = state;

  const handleLogout = () => {
    logoutUser();
    navigate('/institution-select');
  };

  const navigationItems = [
    {
      label: 'Anonymous Feedback',
      path: '/anonymous-feedback',
      icon: <MessageSquare className="h-4 w-4" />,
      public: true,
    },
    {
      label: 'Track Status',
      path: '/status-tracking',
      icon: <Search className="h-4 w-4" />,
      public: true,
    },
  ];

  const authenticatedNavItems = [
    {
      label: 'Dashboard',
      path: '/dashboard',
      icon: <Home className="h-4 w-4" />,
    },
    ...(user.selectedRole?.name === 'Admin' || user.selectedRole?.name === 'Grievance Officer'
      ? [
          {
            label: 'Admin Dashboard',
            path: '/admin-dashboard',
            icon: <Shield className="h-4 w-4" />,
          },
        ]
      : []),
  ];

  const currentItems = user.isAuthenticated
    ? [...authenticatedNavItems, ...navigationItems]
    : navigationItems;

  return (
    <header className="bg-gradient-to-r from-indigo-600 via-purple-600 to-indigo-800 border-b border-white/10 backdrop-blur-sm">
      <div className="container mx-auto px-4">
        <div className="flex items-center justify-between py-3">
          {/* Logo and Title */}
          <div 
            className="flex items-center gap-3 cursor-pointer"
            onClick={() => navigate('/')}
          >
            <div className="flex items-center justify-center w-10 h-10 rounded-full bg-gradient-to-r from-indigo-500 to-purple-600 shadow-lg">
              <Building2 className="h-5 w-5 text-white" />
            </div>
            <h1 className="text-xl font-bold text-white">
              Grievance Portal
            </h1>
          </div>

          <div className="flex items-center gap-4">
            {/* Institution and Role Display */}
            {user.selectedInstitution && (
              <div className="flex items-center gap-2">
                <Badge 
                  variant="secondary" 
                  className="bg-white/15 text-white border-white/20 hover:bg-white/20"
                >
                  {user.selectedInstitution.name}
                </Badge>
                {user.selectedRole && (
                  <Badge 
                    variant="secondary" 
                    className="bg-white/15 text-white border-white/20 hover:bg-white/20"
                  >
                    {user.selectedRole.name}
                  </Badge>
                )}
              </div>
            )}

            {/* Navigation Items */}
            <div className="flex items-center gap-1">
              {currentItems.map((item) => (
                <Button
                  key={item.path}
                  variant={location.pathname === item.path ? "secondary" : "ghost"}
                  size="sm"
                  onClick={() => navigate(item.path)}
                  className={`gap-2 text-white hover:bg-white/10 ${
                    location.pathname === item.path 
                      ? 'bg-white/15 border-white/20' 
                      : 'border-transparent'
                  }`}
                >
                  {item.icon}
                  {item.label}
                </Button>
              ))}

              {/* Chatbot Toggle */}
              <Button
                variant="ghost"
                size="sm"
                onClick={toggleChatbot}
                className={`text-white hover:bg-white/10 ${
                  state.chatbotOpen 
                    ? 'bg-white/15 border-white/20' 
                    : 'border-transparent'
                }`}
                title="Open Help Chat"
              >
                <MessageCircle className="h-4 w-4" />
              </Button>

              {/* Logout Button */}
              {user.isAuthenticated && (
                <Button
                  variant="ghost"
                  size="sm"
                  onClick={handleLogout}
                  className="text-white hover:bg-white/10"
                  title="Logout"
                >
                  <LogOut className="h-4 w-4" />
                </Button>
              )}
            </div>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
